import React from "react";
import { TextField } from "@mui/material";
import { Button } from "@mui/material";
import AddPhotoAlternateIcon from "@mui/icons-material/AddPhotoAlternate";
import ReactQuill from "react-quill";
import "react-quill/dist/quill.snow.css";

const Create = () => {
  const modules = {
    toolbar: [
      [{ header: [1, 2, false] }],
      ["bold", "italic", "underline", "strike", "blockquote"],
      [
        { list: "ordered" },
        { list: "bullet" },
        { indent: "-1" },
        { indent: "+1" },
      ],
      ["link", "image"],
      ["clean"],
    ],
  };
  const formats = [
    "header",
    "bold",
    "italic",
    "underline",
    "strike",
    "blockquote",
    "list",
    "bullet",
    "indent",
    "link",
    "image",
  ];

  return (
    <div className="mx-[66px] mt-10">
      <form className="flex flex-col gap-y-3">
        <TextField label="Title" className="w-[1400px]" />
        <TextField label="Summary" className="w-[1400px]" />
        <Button
          variant="contained"
          component="label"
          endIcon={<AddPhotoAlternateIcon />}
          className="w-[200px]"
          disableElevation
        >
          upload file <input type="file" hidden />
        </Button>
        <ReactQuill modules={modules} formats={formats} />
      </form>
    </div>
  );
};

export default Create;
